    /**
     * List the files in directory for test
     * @return
     */
    public static Vector<String> listTestDir() {
        Vector<String> tmp=new Vector<String>();
        String dir=new File("").getAbsolutePath()+"//test//";
        try {
            File f=new File(dir);
            if (!f.isDirectory()) {
                dir+="//";
                f=new File(dir);
            }
            for (String filename:f.list()) tmp.add(dir+filename);
        } catch(Exception e) {}
        return tmp;
    }


